description:
1904 Blev en amerikansk anka och hennes barn bortforda 
av Berber i Marocko, en handelse som gav genklang inom
politiken och aven engagerade president Theodore Roosevelt. 
Nu gallde det att fa henne frigiven...

Med Sean Connery, Candice Bergen, Brian Keith och John Huston.
